ПАМЯТКА ДЛЯ АДМИНИСТРАТОРА

Для того, чтообы внести изменения в базу данных, Вы должны выбрать пункт из меню, приведенного выше.
После выбора соответствующего пункта Вам открываются поля, в которые можно ввводить данные, и 5 кнопок: delete, add, update, apple, clear.

МЕНЮ "ПОЛЬЗОВАТЕЛЬ"
- Кнопка delete удаляет указанного пользователя по его UserID (остальные поля не имеют значения);
- Кнопка add добавляет пользователя с указанными UserLogin, UserPswd, UserRole (поле UserID не имеет значения);
- Кнопка update обновляет данные в таблице (поля не имеют значения, можно использовать в любой момент);
- Кнопка apply изменяет данные о выбранном пользователе (поле UserID) на данные, указанные в остальных полях (не обязательно все поля должны иметь новые значения);
- Кнопка clear очищает поля данного раздела меню.

!!!ВАЖНО!!!
Какие-либо изменения данных об администраторе(-ах) выполняются только главным администратором. К сожалению, другие администраторы не имеют на это права,
поэтому и не видят информацию о других админах.
Также поле UserLogin имеет уникальное значение, поэтому изменение/добавление в него данных, которые уже присутсвуют в таблице, будет невозможным.
Весь интерфейс имеет "дружелюбное" воздействие с пользователем, выводя соответствующие подсказки на экран при совершении определенных действий.

МЕНЮ "КИНОТЕАТР"
- Кнопка delete удаляет указанный кинотеатр по его CinemaID (остальные поля не имеют значения);
- Кнопка add добавляет кинотеатр с указанными полями (Вы можете посмотреть их, если нажмете эту кнопку, не заполнив все нужные поля);
- Кнопка update обновляет данные в таблице (поля не имеют значения, можно использовать в любой момент);
- Кнопка apply изменяет данные о выбранном кинотеатре (поле CinemaID) на данные, указанные в остальных полях (не обязательно все поля должны иметь новые значения);
- Кнопка clear очищает поля данного раздела меню.

!!!ВАЖНО!!!
Будье ОСТОРОЖНЫ. Удаление кинотеатра влечет за собой удаление всех связанных с ним данных, включая фильмы, отзывы, оценки.
Поле CinemaName имеет уникальные значения, поэтому изменение/добавление в него данных, которые уже присутсвуют в таблице, будет невозможным.
Также поля HouseLetter, HouseDesc и ContactInformation имеют значения по умолчанию, т.е. будут заполнены автоматически, если будут пустыми.
Весь интерфейс имеет "дружелюбное" воздействие с пользователем, выводя соответствующие подсказки на экран при совершении определенных действий.
!!!ВНИМАНИЕ!!!
Чтобы добавить изображение кинотеатра, Вам необходимо указать полный путь до файла со своего компьютера вместе с расширением файла.
Рекомендуемый размер добавяемого изображения: 450x300 и больше (Вы всегда можете удалить изображение и поставить новое через кнопку Apply).

МЕНЮ "ФИЛЬМ"
- Кнопка delete удаляет указанный фильм по его MovieID (остальные поля не имеют значения);
- Кнопка add добавляет фильм с указанными полями (Вы можете посмотреть их, если нажмете эту кнопку, не заполнив все нужные поля);
- Кнопка update обновляет данные в таблице (поля не имеют значения, можно использовать в любой момент);
- Кнопка apply изменяет данные о выбранном фильме (поле MovieID) на данные, указанные в остальных полях (не обязательно все поля должны иметь новые значения);
- Кнопка clear очищает поля данного раздела меню.

!!!ВАЖНО!!!
Будье ОСТОРОЖНЫ. Удаление фильма влечет за собой удаление всех связанных с ним данных, включая отзывы, оценки.
Поле MovieName имеет уникальные значения, поэтому изменение/добавление в него данных, которые уже присутсвуют в таблице, будет невозможным.
Также поля AgeLimit и MovieFormat имеют значения по умолчанию, т.е. будут заполнены автоматически, если будут пустыми.
Весь интерфейс имеет "дружелюбное" воздействие с пользователем, выводя соответствующие подсказки на экран при совершении определенных действий.
!!!ВНИМАНИЕ!!!
Меню "Фильм" имеет две реализации в зависимости от выбранного кинотеатра. Если значение поля CinemaName = None или пустое, то речь идет о регистрации фильма
в таблице, иначе же о добавлении/удалении фильма в соответствующий кинотеатр. Изменение информации о выбранном фильме происходит везде.
Также важно верно заполнять поля с форматом ввода (следите за этим!).

МЕНЮ "Комментарий"
- Кнопка delete удаляет указанный отзыв по его ReviewID (поле Comment не имеет значения);
- Кнопка add добавляет текст комментария пользователя с указанным ReviewID в поле Comment;
- Кнопка update обновляет данные в таблице (поля не имеют значения, можно использовать в любой момент);
- Кнопка apply изменяет комментарий выбранного отзыва (поле ReviewID) на текст, указанный в поле Comment;
- Кнопка clear очищает поля данного раздела меню.

!!!ВАЖНО!!!
Весь интерфейс имеет "дружелюбное" воздействие с пользователем, выводя соответствующие подсказки на экран при совершении определенных действий.
!!!ВНИМАНИЕ!!!
Администрирование комментариев выполняется след. образом:
1. Выбирается подозрительный комментарий пользователя;
2. Копируется ReviewID отзыва с подозрительным комментарием в соответствующее поле;
3. Кнопкой Add текст комментария экспортируется в поле Comment;
4. В зависимости от принятого Вами решения (админинстратором) можно либо изменить (поле Comment) -> кнопка Apply, либо удалить -> кнока Delete рассматриваемый комментарий.
5. После нажатия кнопки Update изменения будут видны в таблице.

!!!ОБЩАЯ ВАЖНАЯ ИНФОРМАЦИЯ!!!
Избегайте использования символа одинарных кавычек ', иначе со стороны сервера будет выдана ошибка, которую можно просто закрыть, но данные не будут обновлены!
